  constructor() {
    super();

    this.state = {
      peopleArr: data
    }
  }


  render() {

    console.log(this.state.peopleArr);

    return (
      <div id = "main">
        <Top />
        <Slides peopleArr = {this.state.peopleArr}/>
      </div>
    );
  }
}

export default App;
